Okay, Computational Modeler at your service! Designing models for decision-making tasks like the Ultimatum Game is fascinating. The challenge of capturing the interplay between self-interest and fairness, while ensuring the underlying parameters are reliably estimated, is the core of the fun. Let's tackle this responder model with the new structure focusing on differential parameter influence for improved identifiability.

Here is the model specification:

<MODEL>
sum_tokens = token_self + token_opp
fair_perc_self_calc = IF(sum_tokens == 0, 50.0, (token_self / sum_tokens) * 100.0)
loss_below_fair = Max(0.0, fair_perc_self_calc - split_perc_self)
U_accept = split_perc_self^beta_value - beta_unfairness * loss_below_fair
</MODEL>

<VARIABLES>
{
  "variables": {
    "sum_tokens": {
      "description": "Total number of tokens found by participant and opponent combined",
      "range": {
        "min": 0,
        "max": 200,
        "inclusive_min": true,
        "inclusive_max": true
      },
      "learnable": false,
      "source": "calculated"
    },
    "fair_perc_self_calc": {
      "description": "Calculated fair percentage share for the participant based on token contributions, defaulting to 50% if total tokens are zero",
      "range": {
        "min": 0.0,
        "max": 100.0,
        "inclusive_min": true,
        "inclusive_max": true
      },
      "learnable": false,
      "source": "calculated"
    },
    "loss_below_fair": {
      "description": "The magnitude of the difference between the calculated fair percentage share and the proposed percentage share, when the proposed share is less than fair. Zero otherwise.",
      "range": {
        "min": 0.0,
        "max": 100.0,
        "inclusive_min": true,
        "inclusive_max": true
      },
      "learnable": false,
      "source": "calculated"
    },
    "U_accept": {
      "description": "Utility of accepting the proposed offer",
      "range": {
        "min": "-inf",
        "max": "inf"
      },
      "learnable": false,
      "source": "calculated"
    },
    "beta_value": {
      "description": "Sensitivity or shape parameter for the utility derived from the proposed percentage gain. Higher values imply increasing returns, lower values (between 0 and 1) imply diminishing returns, 1 implies linear returns.",
      "range": {
        "min": 0.01,
        "max": 10.0,
        "inclusive_min": true,
        "inclusive_max": true
      },
      "learnable": true,
      "source": "learnable"
    },
    "beta_unfairness": {
      "description": "Sensitivity or aversion parameter to loss below the fair share. Scales the penalty incurred when the proposed percentage share is below the calculated fair share.",
      "range": {
        "min": 0.0,
        "max": 10.0,
        "inclusive_min": true,
        "inclusive_max": true
      },
      "learnable": true,
      "source": "learnable"
    },
    "token_self": {
      "description": "Number of tokens found by the participant (participant's contribution)",
      "range": {
        "min": 0,
        "max": 100,
        "inclusive_min": true,
        "inclusive_max": true
      },
      "learnable": false,
      "source": "data"
    },
    "token_opp": {
      "description": "Number of tokens found by the opponent (opponent's contribution)",
      "range": {
        "min": 0,
        "max": 100,
        "inclusive_min": true,
        "inclusive_max": true
      },
      "learnable": false,
      "source": "data"
    },
    "split_perc_self": {
      "description": "The proposed percentage share for the participant",
      "range": {
        "min": 0.0,
        "max": 100.0,
        "inclusive_min": true,
        "inclusive_max": true
      },
      "learnable": false,
      "source": "data"
    },
    "accept": {
      "description": "Whether the participant accepted (1) or rejected (0) the offer",
      "range": {
        "min": 0,
        "max": 1
      },
      "learnable": false,
      "source": "data"
    }
  }
}
</VARIABLES>

<target_variable>accept</target_variable>

<SUMMARY>
This model predicts the utility of accepting an offer in the Ultimatum Game for the responder role. Utility is calculated as the difference between a power-law function of the proposed percentage share for the participant and a linear penalty based on how far the offer is below a calculated fair share. The parameter beta_value acts as an exponent on the percentage gain, shaping its utility. The parameter beta_unfairness linearly scales the penalty associated with offers below the fair share, representing sensitivity to unfairness. This structure, where beta_value affects a non-linearity on gain and beta_unfairness scales a linear loss, is designed to create mathematically distinct parameter influences to improve robust joint identifiability compared to previous model attempts.
</SUMMARY>

